import { Main } from "./components/Main";
import { Footer } from "./components/Footer";
import { Pages } from "./components/Pages";
import { BrowserRouter as Router } from "react-router-dom";
function App() {
  return (
    <div className="App">

      <Router>
        <Header />
        <Pages/>
        <Main />
        <Footer />
      </Router>
    </div>
  );
}

export default App;
